Node - Mongo DB - How do I query for a specific nested field<p>In short: I setup up session authentication for my node-express app with mongodb. If a user has already a valid session entity in the db a new session should NOT be created. Now I want to make a query for the specific user-id in my session collection.</p>

<h2>Collection</h2>

<p>The collection looks like follows:</p>

<pre><code>{"_id":"HbAE-qMXPWl7C8tDUnC****q8OoEf76vN","expires":{"$date":{"$numberLong":"1576133617190"}},"session":"{\"cookie\":{\"originalMaxAge\":86399999,\"expires\":\"2019-12-12T06:36:29.898Z\",\"secure\":false,\"httpOnly\":true,\"path\":\"/\",\"sameSite\":true},\"user\":{\"uid\":\"5df08a1b8a60c174840d2986\"}}"}
</code></pre>

<p>And my query looks like this:</p>

<pre><code>public async compareSessionIds(uid: string, sid: string) {
    //uid is: 5df08a1b8a60c174840d2986 ==&gt; the same as in the entity
    const user: User | null = await this.connectionManager.db('users').collection&lt;User&gt;('sessions').findOne({uid: uid} as any);
    console.log('user found: ', user); // user found:  null
    return user &amp;&amp; user._id === sid;
}
</code></pre>

<p>But my query returns everytime <code>null</code> so I am assuming my query is wrong. How do I query correctly for a specific nested field in mongodb?</p>

